text:
@StineBHelles @hjemimand @LoumannPernille “denne anonyme profil”?! Det er jo et komplet tomt argument, Stine! Jeg er ligeså meget et rigtigt menneske som dig - jeg har bare ikke behov for selvpromovering.

Så prøv at droppe ad hominem og forholde dig til substansen. Disse tal er officielle og korrekte.

#dkpol #dkgreen https://t.co/fRDQyIIoeC

@AShenningsen @TonnyANielsen Hvad der skal gøres - ved hvad?

Præsenter en konkret problem med “mangel på ressourcer” (vi mangler ikke ressourcer, vi har prissystemet som styrer det og mennesket innoverer konstant, hvis det får frihed til det), så skal jeg pege på en “løsning”.

#dkpol #dkgreen #myter

@AShenningsen @TonnyANielsen Det er den mindst skadelige model. Men afgiften skal ikke være kunstigt høj for så skader den alt for meget - og så vil ingen i verden være med.

Men det er jo ikke hvad vi ser ske. I stedet øver politiker samfundsskade ved utallige dyre og unyttige føle-tiltag.

#dkpol #dkgreen

@EnerginetDK har tildelt opgaven med at udføre miljøundersøgelser af energiøerne til NIRAS og @ramboll 
https://t.co/qHQlRZnGCe
#dkpol #dkgreen #energiøer

@grunberg14 @dobije @ErlingWorm @SoldrengenJacob @denrigtigenima Det handler om at de ønsker at have monopol på at ytre sig. De bryder sig ikke om, at andre mennesker pludselig kan komme til orde.

Det er hvad venstrefløjsmedier som DRs kampagne om “grimme ord på sociale medier” primært handler om; om genindførsel af censur.

#dkpol #dkmedier

@rulgw @Joymogensen Hun har ikke kunnet gøre ret meget, da Coronapandemien har bestemt det meste, og man altid åbner uddannelser, butikker osv. før teatre og kirker.

Det må have været frustrerende ikke at kunne gøre noget.

#dkpol

Hvor ville jeg ønske, at vi i disse tider havde en forsvarsminister med forstand på... ja, Forsvaret.

@Trinebramsen er ikke kvalificeret overhovedet.

#dkpol

@GunRestless De har jo ikke vundet over USA. Den uduelige Joe Biden har på komplet uansvarlig vis trukket tæppet væk under muligheden for at Afghanistan kunne holde Taliban stangen.

Hvis Trump havde udført tilbagetrækning så idiotisk ville #dkmedier have beskyldt ham dagen lang.

#dkpol

